import React from 'react';

interface ProjectProps {
  name: string;
  description: string;
  link: string;
  img: { src: string; alt: string };
  category: JSX.Element;
}

const Project: React.FC<ProjectProps> = ({ name, description, link, img, category }) => {
  return (
    <div className="border border-gray-300 p-4 rounded-md shadow-md bg-gray-900 text-white">
      <h2 className="text-xl font-semibold mb-2">{name}</h2>
      <p className="text-gray-300 mb-2">{description}</p>
      <a href={link} className="block mb-2">
        <img src={img.src} alt={img.alt} className="rounded-md" />
      </a>
      <div>{category}</div>
    </div>
  );
};

interface TagsProps {
  color: string;
  children: React.ReactNode;
}

const Tags: React.FC<TagsProps> = ({ color, children }) => {
  return <span style={{ color }} className="mr-2">{children}</span>;
};

interface SectionProps {
  title: string;
  children: React.ReactNode;
}

const Section: React.FC<SectionProps> = ({ title, children }) => {
  return (
    <div className="mb-4">
      {title && <h1 className="text-3xl font-semibold mb-4 text-white">{title}</h1>}
      {children}
    </div>
  );
};

const ColorTags = {
  FUCHSIA: '#FF00FF',
  LIME: '#00FF00',
  SKY: '#87CEEB',
  ROSE: '#FF007F',
  VIOLET: '#8A2BE2',
  EMERALD: '#50C878',
  YELLOW: '#FFFF00',
  INDIGO: '#4B0082',
};

const Projects: React.FC = () => {
  return (
    <div className="container mx-auto px-3 mt-16">
      <div className="section flex flex-col justify-center items-center text-center">
        <h1 className="text-4xl mb-4 text-[#61dafb]">Projects</h1>
      </div>
      <Section title="">
        <div className="flex flex-col gap-6 mx-16 mt-2">
          <Project
            name="Project 1"
            description="Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse bibendum. Nunc non posuere consectetur, justo erat semper enim, non hendrerit dui odio id enim."
            link="/"
            img={{ src: '/assets/images/project-web-design.png', alt: 'Project Web Design' }}
            category={
              <>
                <Tags color={ColorTags.FUCHSIA}>Astro.js</Tags>
                <Tags color={ColorTags.LIME}>Web design</Tags>
                <Tags color={ColorTags.SKY}>Tailwind.css</Tags>
                <Tags color={ColorTags.ROSE}>TypeScript</Tags>
              </>
            }
          />
          <Project
            name="Project 2"
            description="Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse bibendum. Nunc non posuere consectetur, justo erat semper enim, non hendrerit dui odio id enim."
            link="/"
            img={{ src: '/assets/images/project-fire.png', alt: 'Project Fire' }}
            category={
              <>
                <Tags color={ColorTags.VIOLET}>Next.js</Tags>
                <Tags color={ColorTags.EMERALD}>Blog</Tags>
                <Tags color={ColorTags.YELLOW}>JavaScript</Tags>
              </>
            }
          />
          <Project
            name="Project 3"
            description="Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse bibendum. Nunc non posuere consectetur, justo erat semper enim, non hendrerit dui odio id enim."
            link="/"
            img={{ src: '/assets/images/project-maps.png', alt: 'Project Maps' }}
            category={
              <>
                <Tags color={ColorTags.FUCHSIA}>Astro.js</Tags>
                <Tags color={ColorTags.INDIGO}>Bootstrap</Tags>
                <Tags color={ColorTags.ROSE}>TypeScript</Tags>
              </>
            }
          />
        </div>
      </Section>
    </div>
  );
};

export default Projects;
